import React, { useState } from "react";
import styles from "./Transaction.module.css";

const initialForm = { type: "expense", amount: "", category: "Other", date: "", note: "" };

const Transaction = () => {
  const [form, setForm] = useState(initialForm);
  const [history, setHistory] = useState([
    { id:1, type:"income", amount:1200, category:"Salary", date:"2025-08-01", note:"August" },
    { id:2, type:"expense", amount:45, category:"Food", date:"2025-08-03", note:"Lunch" },
  ]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm(prev => ({...prev, [name]: value}));
  };

  const handleAdd = (e) => {
    e.preventDefault();
    const amt = parseFloat(form.amount);
    if (!amt || isNaN(amt)) return alert("Введите корректную сумму");
    const newItem = { id: Date.now(), ...form, amount: amt };
    setHistory([newItem, ...history]);
    setForm(initialForm);
  };

  return (
    <div className="container">
      <h1 className={styles.title}>New Transaction</h1>

      <div className={styles.layout}>
        <form className={styles.form} onSubmit={handleAdd}>
          <label>Type</label>
          <select name="type" value={form.type} onChange={handleChange}>
            <option value="expense">Expense</option>
            <option value="income">Income</option>
            <option value="transfer">Transfer</option>
          </select>

          <label>Amount</label>
          <input name="amount" value={form.amount} onChange={handleChange} placeholder="0.00" />

          <label>Category</label>
          <input name="category" value={form.category} onChange={handleChange} />

          <label>Date</label>
          <input name="date" type="date" value={form.date} onChange={handleChange} />

          <label>Note</label>
          <input name="note" value={form.note} onChange={handleChange} />

          <button className={styles.saveBtn} type="submit">Add Transaction</button>
        </form>

        <div className={styles.history}>
          <h3>Recent</h3>
          <ul>
            {history.map(h => (
              <li key={h.id} className={h.type === "income" ? styles.income : styles.expense}>
                <div className={styles.hRow}>
                  <div className={styles.hMain}>
                    <div className={styles.hCat}>{h.category}</div>
                    <div className={styles.hNote}>{h.note}</div>
                  </div>
                  <div className={styles.hAmount}>
                    {h.type === "expense" ? "-" : "+"}${h.amount}
                  </div>
                </div>
                <div className={styles.hDate}>{h.date}</div>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Transaction;
